  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:09.416483\",\n\t\"name\": \"mercury-and-selenium-concentrations-in-largemouth-bass-and-other-fishes-of-the-lower-suwan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"From March 22 to April 7, 1990, 71 largemouth
  bass (Micropterus salmoides) and four other fish species (total of seven fish) were
  collected from ten locations on or adjacent to the Lower Suwannee National Wildlife
  Refuge and in the Santa Fe River, Florida. The fish were collected for mercury and
  selenium analyses of muscle tissue. Fifty-five percent of the bass had mercury levels
  that exceeded the Florida limited consumption concentration of 0.5 parts per million
  (ppm), wet weight. Three percent exceeded Florida's no-consumption concentration
  of 1.5 ppm. Two other species, spotted gar (Lepisosteus oculatus) and yellow bullhead
  (Ameiurus natalis), also had high levels of mercury. Evaluation of weight, length
  and age of largemouth bass did not provide mechanisms by which recreational fishermen
  could selectively retain bass that are low in mercury. No direct association was
  observed between mercury and selenium concentrations in muscle tissue. However,
  fish egg data (from this study and from various other sources) indicate that selenium
  concentrations greatly exceed mercury concentrations. Four sampling locations, the
  Suwannee River, Santa Fe River, Sand Fly Creek and Week Creek appear to provide
  high mercury environments for largemouth bass. Fish and wildlife trust resources
  may be at some risk when utilizing these areas. Additional geographic and biotic
  environmental contaminant work is recommended.\",\n\t\"license_title\": \"License
